import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Home from './pages/Home'
import New from './pages/New'
import Edit from './pages/Edit'
import Diary from './pages/Diary'
import MyButton from './components/MyButton';
import MyHeader from './components/MyHeader';

function App() {
  const env = process.env
  env.PUBLIC_URL = env.PUBLIC_URL || ""

  return (
    <BrowserRouter>
      <div className="App">
        <MyHeader
          headText={"App"}
          leftChild={
            <MyButton text={"왼쪽버튼"} onClick={() => alert("왼쪽클릭")} />
          }
          rightChild={
            <MyButton text={"오른쪽버튼"} onClick={() => alert("오른쪽클릭")} />
          }
        />
        <h2>안녕!</h2>
        <img src={process.env.PUBLIC_URL + `/assets/5.png`} />

        <MyButton text={'버튼'} onClick={() => alert('클릭했습니다.')} type={"positive"} />
        <MyButton text={'버튼'} onClick={() => alert('클릭했습니다.')} />
        <MyButton text={'버튼'} onClick={() => alert('클릭했습니다.')} type={"negative"} />

        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/New' element={<New />} />
          <Route path='/Edit' element={<Edit />} />
          <Route path='/Diary/:id' element={<Diary />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
